import React from 'react';
const userProfile=()=>{
    return(
        <div>
            <h3>User Profile Page</h3>
            <p>Name: Jane Doe</p>
            <p>Email: janedoe@beautyexpery.com</p>
            <p>Contact no.: 123 2345 234</p>

            <h3>Beauty Preferences</h3>
            <p>Favourate services: makeupp, hair color</p>
            <p>Preffered experts: Sarah, Emily</p>
            
        </div>
    );
};
export default userProfile;
